import logo from './logo.svg';
import './App.css';
import { Route,BrowserRouter as Router, Routes } from 'react-router-dom';
import './Login.js'
import './Signup.js'

function App() {
  return (
<div>
  <header>
    <div>Trainees to devolepers</div>

    <div>
<Router>
  <div>
  <li to={'/Signup'}>Login</li>
  <li to={'/Login'}>Sign up</li>
  </div>
  <Routes>
    <Route exact path='/Signup' element={<Signup/>}></Route>
    <Route exact path='/Login' element={<Login/>}></Route>
  </Routes>
</Router>
    </div>


  </header>
</div>
  );
}

export default App;
